.footerFAQs {
  padding-top: 40px;
  display: block;
  color: #fff;
  background: #080d1f;

  .container {
    position: relative;
    max-width: 1140px;
    width: 100%;
    padding-right: 15px;
    padding-left: 15px;
    margin-right: auto;
    margin-left: auto;
  }

  .blockRow {
    display: flex;
    border-color: rgba(139, 141, 150, 0.28);
    padding: 3rem 0 !important;
  }

  .block {
    flex: 1;
    padding-right: 20px;
    position: relative;

    h4 {
      font-size: 16px;
      margin-bottom: 20px;
      margin-top: 8px;
      color: #fff;
    }

    li p {
      margin-bottom: 10px;
      a {
        color: #fff;
        opacity: 0.6;
        line-height: 30px;
      }
    }

    .language {
      display: flex;
      justify-content: flex-end;
      align-content: center;
      button {
        display: inline-block;
        font-weight: 400;
        text-align: center;
        vertical-align: middle;
        user-select: none;
        border: 1px solid transparent;
        padding: 0.8rem 0.75rem;
        border-radius: 0.25rem;
        color: #fff;
        background: #171b2c;
        display: flex;
        align-content: center;
      }
      span {
        color: #fff;
      }
    }
  }

  .logo {
    margin-bottom: 0.5rem;
    margin-right: 2rem;
    img {
      max-width: 100%;
      font-style: italic;
      vertical-align: middle;
    }
    a {
      color: #fa2843;
      text-decoration: none;
    }
  }

  .ft-1 {
    padding: 3rem 0;
  }

  .des1,
  .des2 {
    margin-bottom: 1rem;
  }
}
@media (max-width: 576px) {
  .footerFAQs {
    .blockRow {
      display: unset;
    }

    .logo p img {
      width: 100%;
      object-fit: cover;
      margin-bottom: 10px;
    }

    .block {
      flex: unset;
      .language {
        justify-content: flex-start !important;
        margin-top: 20px;
      }
    }
  }
  .footerFAQs {
    .blockRow {
